const Button = styled.button`
    padding: 5px 15px;
    background-color: transparent;
    border; 1px solid #3ea6ff;
    color: #3ea6ff;
    border-redius: 3px;
    font-weight: 500;
    margin-top: 10px;
    cursor: pointer;
    display: flex;
    align-items: center;
    gap: 5px;
`;


const Navbar = () => {
    return (
        <div>Navbar</div>
    )
}

export default Navbar
